    useEffect(()=>{
        fetch('https://api.themoviedb.org/3/movie/popular?api_key=8e647b6393150bbda1a91e715d50e47f').catchthen
    })
  return (
    <div>
      Snehal Karki
    </div>
  )
}

export default Home
